import React from 'react';
import './Country.css';
import { useSelector } from 'react-redux';

const Country = () => {
     const { characters } = useSelector(state => state.Country);
     return (
        <div>
        {characters.map(char => {  
              return <Country
              id={char.id} 
              name={char.name}
               flag={char.flag}
               capital={char.capital}
               continet={char.continent}
               population={char.poblation}
                
            />
             })}
            </div>
) }



export default Country;
